INSERT INTO `news` (`id`, `title`, `text`, `status_id`, `date`, `image`, `url`, `author_id`) VALUES
(1, 'У ДДМА відбувся святковий концерт до Дня Збройних Сил України', '6 грудня в актовому залі Академії на честь Дня Збройних Сил України відбувся святковий концерт. Із привітальним словом виступили перший проректор ДДМА Анатолій Фесенко, член вищої ради українського реєстрового козацтва, головний отаман Донецької області, радник міського голови м. Краматорськ, генерал Сергій Міхальков, командир окремого ремонтно-відновлювального батальйону ООС, підполковник Сергій Дешевенко.', 1, '2018-10-08 19:53:27', '1.jpg', 'http://www.dgma.donetsk.ua/u-ddma-vidbuvsya-svyatkoviy-kontsert-do-dnya-zbroynih-sil-ukrayini-2018.html', 1),
(2, 'Шахісти ДДМА стали кращими в області серед студентів', '5 грудня в Краматорську відбувся обласний турнір із шахів пам`яті І.М. Митька серед ЗВО III–IV рівнів акредитації. ДДМА представляли три команди: Олександр Касьянюк, Олена Мартинкова, Михайло Сафронов – команда ДДМА-1; Олена Балаболко, Андрій Касьянюк, Ярослав Недоруба – ДДМА-2; В\'ячеслав Хруслов, Андрій Літвінов, Дарія Чернишова – ДДМА-3.\r\n\r\nЗа результатами змагань наші студентки стали кращими шахістками області. В особистому заліку серед дівчат 1-е місце завоювала Олена Мартинкова (майстер спорту міжнародного класу); 2-е місце виборола Олена Балаболко (1-й розряд); 3-є місце – Дарія Чернишова.\r\n\r\nВ особистому заліку серед юнаків 3-є місце посів Михайло Сафронов (кандидат у майстри спорту).', 1, '2018-12-12 04:08:00', '2.jpg', 'http://www.dgma.donetsk.ua/shahistki-ddma-stalili-kraschimi-v-oblasti-sered-studentiv.html', 1),
(3, 'Із днем народження, ФІТО!', '5 грудня в актовому залі ДДМА відбувся концерт, присвячений Дню народження ФІТО.\r\n\r\nСвяткування дня народження почалося зі стендапу, де продемонстрували еволюцію студентів факультету. Присутнім у залі також видалася можливість згадати танець першокурсників, який вони танцювали на Дебюті. Запальні танці, пісні та смішний інтелектуальний батл між студентами та викладачами не залишили нікого байдужими. Глядачі дуже тепло зустрічали всіх учасників концерту та підтримували їх бурхливими оплесками.\r\n\r\nДекан факультету Олександр Гринь привітав із таким чудовим святом усіх присутніх у залі. Він розповів про досягнення факультету за рік, що супроводжувалося презентацією. Із привітаннями до працівників і студентів вийшов на сцену перший проректор ДДМА Анатолій Фесенко. Кращі студенти, викладачі й співробітники факультету були нагороджені почесними грамотами.', 1, '2018-12-13 00:00:00', '3.jpg', 'http://www.dgma.donetsk.ua/iz-dnem-narodzhennya-fito.html', 1),
(4, 'PRO справжній образ Донбасу', '3 грудня в рекреації біля музею ДДМА відбулося відкриття виставки «Донбас: переPROчитання образу». На відкриття зібрались студенти і викладачі ДДМА, учні й вчителі шкіл. Виставка складається з декількох стендів, на яких надані штрихи до справжньої історії Донбасу.\r\n\r\nВиставку відкрив заступник голови Донецької облдержадміністрації Ігор Стокоз. Він підкреслив те, що існують міфи, нібито Донеччина – це якийсь окремий регіон. Це не так. Історія доводить, що саме тут українська нація гартувалась сотні років, проявляючи себе з найкращої сторони в найбільш важкі часи. Виставка допомагає зрозуміти, що Україна тут була, є і буде завжди.\r\n\r\nСпівробітник Українського інституту національної пам\'яті Ігор Каретніков розповів про ідею формування виставки.', 1, '2018-12-18 00:00:00', '4.jpg', 'http://www.dgma.donetsk.ua/pro-spravzhniy-obraz-donbasu.html', 1),
(5, 'Знайомитись зі спеціальностями можна дуже весело!', '1 грудня Академія відкрила свої двері для майбутніх абітурієнтів із Краматорська, Слов`янська, Дружківки та Торецька. Випускники коледжів, технікумів, ВПУ завітали до нас, щоби ближче познайомитися з Академією і дізнатися, як до неї вступити. Більшість випускників уже планують вступати до нашого вишу, а ті, хто тільки обдумує, де продовжити навчання, мали змогу краще дізнатися про навчання в ДДМА. День відкритих дверей у цьому році проходив у вигляді цікавого квесту.', 1, '0000-00-00 00:00:00', '5.jpg', 'http://www.dgma.donetsk.ua/znayomitis-zi-spetsialnostyami-mozhna-duzhe-veselo.html', 0),
(6, 'Вітаємо з нагородою!', 'Ректор ДДМА Віктор Ковальов – голова Донецького наукового центру Національної академії наук України і Міністерства освіти і науки України, доктор технічних наук, професор, нагороджений Почесною відзнакою Національної академії наук України за вагомий особистий внесок у розвиток вітчизняної науки, зміцнення науково-технічного потенціалу України, багаторічну сумлінну працю, високий професіоналізм та з нагоди 100-річчя Національної академії наук України.', 1, '2018-12-13 05:09:11', '6.jpg', 'http://www.dgma.donetsk.ua/vitaemo-z-nagorodoyu.html', 1),
(7, 'Творимо добро!', 'До Дня святого Миколая, 21 грудня, волонтери ДДМА взяли участь у театральній постанові «Випадкові зустрічі», яка пройшла в Центрі соціально-психологічної реабілітації дітей. Після вистави наші волонтери спільно з Асоціацією молоді НКМЗ провели конкурсну програму і святкову дискотеку для дітей Центру.', 1, '2018-12-12 00:15:14', '7.jpg', 'http://www.dgma.donetsk.ua/tvorimo-dobro.html', 1),
(8, 'Студентка ДДМА увійшла у п’ятірку сильніших шахісток України', 'Першокурсниця нової спеціальності ДДМА «Фізична культура і спорт» Олена Мартинкова (ФКС-18-1), майстер спорту міжнародного класу, узяла участь у фіналі чемпіонату України з шахів серед жінок, який проходив у Києві з 10 по 20 грудня. У турнірі за коловою системою грали 10 кращих шахісток нашої країни з Донецької, Харківської, Львівської, Херсонської, Миколаївської, Тернопільської, Вінницької областей і Києва. Наймолодшій учасниці було 15 років, найстаршій – 40. Олена єдина спортсменка з Донецької області, по дві шахістки представляли Харківську область та Київ.\r\n\r\nСклад спортсменів був рівний – два члени збірної України, призери й переможці чемпіонатів України, Європи та світу. Не було легких і прохідних партій. За результатами ігор наша шахістка набрала 4 очки з 9 можливих і посіла 5-е місце.', 1, '2018-12-19 05:00:12', '8.jpg', 'http://www.dgma.donetsk.ua/studentka-ddma-uviyshla-u-pyatirku-silnishih-shahistok-ukrayini.html', 1),
(9, 'ДДМА стала переможцем обласної універсіади', '19 грудня в ДДМА відбулася нарада Донецького обласного відділення (філії) Комітету з фізичного виховання та спорту Міністерства освіти і науки України з керівниками фізичного виховання закладів вищої освіти Донецької області.\r\n\r\nimg_main.jpg\r\nНа нараді були нагороджені навчальні заклади, які посіли призові місця в Універсіаді та обласних змаганнях серед студентів ЗВО та брали активну участь у спортивному житті області. В Універсіаді змагалися 8 вишів із таких видів спорту, як бадмінтон, настільний теніс, баскетбол, волейбол, легка атлетика, футзал, скелелазіння, волейбол пляжний, футбол, класичний пауерліфтинг, шахи.', 1, '2018-12-20 04:29:00', '9.jpg', 'http://www.dgma.donetsk.ua/ddma-stala-peremozhtsem-oblasnoyi-universiadi.html', 1);
